import React, { useState } from "react";
import Axios from "axios";

function Login() {
  const baseurl = "http://localhost";
  const port = ":3001";

  Axios.get(baseurl + port + "/geturl/" + props.match.params.code)
    .then((response) => {
      console.log(response.data);
      if (response.data.length > 0) {
        window.location.href = response.data[0].fullurl;
      } else {
        props.history.push("/page/404");
      }
    })
    .catch((error) => {
      console.log(error);
    });

  return (
    <div className="container">
      <h1>Login System</h1>
      <div className="row justify-content-md-center">
        <div className="col col-lg-2">1 of 3</div>
        <div className="col-md-auto">Variable width content</div>
        <div className="col col-lg-2">3 of 3</div>
      </div>
    </div>
  );
}

export default Login;
